import React from "react";
import Circle from "./Components/Circle.tsx";
import "./App.css";

const App = () => {
  return (
    <>
      <div>
        <Circle courseName={"BioE 10"} id={"bioe10"} />
        <Circle courseName={"BioE 11"} id={"bioe11"} />
      </div>
    </>
  );
};

export default App;
